import React, { Fragment } from "react";



const login = () => {
  return (
    <div>
      <h2>LOGIN</h2>
    </div>
  );
};

const logout = () => {
  return (
    <div>
      <h2>LOGOUT</h2>
    </div>
  );
};

const inicio = false;
const P = () => {
  return <Fragment>{inicio ? login() : logout()}</Fragment>;
};

export default P;
